create table plant
(
    plantId             binary(16)   not null
        primary key,
    plantFamilyName     varchar(128) null,
    plantCommonName     varchar(128) null,
    plantScientificName varchar(128) not null,
    plantColor          varchar(128) null,
    plantImageUrl       varchar(128) null,
    plantDuration       varchar(300) null,
    plantSunlight       varchar(128) null,
    plantSize           varchar(128) null
);

